import * as React from "react";
import { AppBar, Toolbar } from "@material-ui/core";
import { IconButton } from "@material-ui/core";
import { Home } from "@material-ui/icons";
import { List, ListItem, ListItemText } from "@material-ui/core";
import { makeStyles } from "@material-ui/core";
import { Container } from "@material-ui/core";
import { Button } from "@material-ui/core";
import {
  FiHome,
  FiCoffee,
  FiCodesandbox,
  FiActivity,
  FiSmartphone,
  FiUserCheck,
} from "react-icons/fi";
import { Link } from "react-router-dom";
import SideDrawer from "../drawer/drawer";
import { Hidden } from "@material-ui/core";
import purple from "@material-ui/core/colors/purple";

const useStyles = makeStyles({
  navDisplayFlex: {
    display: "flex",
    justifyContent: "space-between",

    // color: "#01573d",
  },
  linkText: {
    textDecoration: "none",
    textTransform: "uppercase",
    color: "#01573d",
  },
  icon: {
    width: "30px",
  },
  color: {
    background: "#01573d",
  },
  btn: {
    // background: "linear-gradient(45deg, #FE6B8B 30%, #FF8E53 90%)",
    background: "#01573d",
    borderRadius: 30,
    border: "3px solid #5de204",
    color: "white",
    height: 48,
    padding: "0 30px",
    "&:hover": {
      backgroundColor: "#01573d !important",
    },
  },
  label: {
    textTransform: "capitalize",
  },
});

export const Navbartest = () => {
  const navLinks = [
    { title: "Sobre", path: "/#" },
    { title: "Servi√ßos", path: "/#" },
    { title: "Equipe", path: "/#" },
    { title: "Contato", path: "/#" },
  ];

  const classes = useStyles();
  return (
    <AppBar position="static" className={classes.color}>
      <Toolbar>
        <Container maxWidth="md" className={classes.navDisplayFlex}>
          <IconButton edge="start" color="inherit" aria-label="home">
            <Home fontSize="large" />
          </IconButton>
          <Hidden smDown>
            <List
              component="nav"
              aria-labelledby="main navigation"
              className={classes.navDisplayFlex}
            >
              {/* {navLinks.map(({ title, path }) => (
                <a href={path} key={title}>
                  <ListItem button>
                    <ListItemText primary={title} style={{ color: `white` }} />
                  </ListItem>
                </a>
              ))} */}
              {/* <Link to="/">
                <FiHome /> Home
              </Link> */}

              <li>
                <Link className=" icon-menu-top nav-link scrollto" to="/">
                  <FiHome /> Home
                </Link>
              </li>
              <li>
                <Link className="nav-link scrollto icon-menu-top" to="#about">
                  {" "}
                  <FiCodesandbox />
                  Sobre
                </Link>
              </li>
              <li>
                <Link className="nav-link scrollto" to="#services">
                  <FiActivity />
                  Servi√ßos
                </Link>
              </li>
              <li>
                <Link className="nav-link scrollto" to="#team">
                  <FiCoffee />
                  Equipe
                </Link>
              </li>

              <Button variant="contained" className={classes.btn}>
                LOGIN
              </Button>
            </List>
          </Hidden>
          <Hidden mdUp>
            <SideDrawer />
          </Hidden>
        </Container>
      </Toolbar>
    </AppBar>
  );
};
